INSERT INTO `email_template` VALUES (1,'registration_user','Регистрация на проекте microTasker','Здравствуйте! Вы успешно прошли регистрацию в проекте <strong>microTasker</strong>! Никакой дальнейшей активации не требуется. <br />Надеемся, что вам будет весело пользоваться нашим проектом! <br />'),(2,'registration_admin','Регистрация нового пользователя','Пользователь {%full_name%} зарегистрировался'),(3,'password_recovery_user','Восстановление пароля','Доброго времени суток, {%full_name%} Вы запросили воcстановление пароля на сайте <strong>Microtasker</strong>.Перейдите по {%LINK%} для установки нового пароля.Если запрос отправляли не Вы, проигнорируйте это письмо.'),(4,'contactus_message_user','Проект DEV2. Ваше сообщение очень важно для нас!','Уважаемый {%name%}! Спасибо за Ваше сообщение! Оно очень важно для нас!'),(5,'contactus_message_admin','Проект DEV2. Новое сообщение','Некто {%name%} прислал сообщение. Текст: {%message%} E-Mail: {%email%}'),(6,'social_bridge_user_confirm_email_user','demo.web375.org - Подтверждение электронного адреса в соцсети {%network_name%}','Подтвердите Email {%email%}, перейдя по ссылке {%link%} Либо используйте данный код {%token%} ');
