INSERT INTO `page` VALUES (1,'microTasker - Лента','Привет тебе, юный друг! Ты попал на этот сайт, потому что тебе самому нужен сайт. А может быть, ты просто зашел сюда случайно! В любом случае, добро пожаловать!',1,'default',1,'default',0,'/',5,'','dobro-pozhalovat','microTasker - Лента','',''),(2,'Что такое microTasker?','Привет тебе, <span style=\"font-size: medium;\">юный друг</span>!<br /><br />Если ты ищешь помощи в делах насущных, то ты нашел ее! <span style=\"font-size: small;\"><strong>МикроТаскер </strong></span>- это уникальная возмножность провести свое время с пользой! <br /><br />Создай себе цепочку задач и выполняй ее! Когда ты выполнишь задачу, отметь ее и приступай к следующей. Все выполненные задачи сохраняются системой, и в конце недели <span style=\"font-size: small;\"><strong>ты получишь отчет</strong></span> о всех задачах, выполненных тобой в течение недели.<br /><br />Однако, есть небольшие ограничения. Так, если задача не выполняется в течение <span style=\"font-size: small;\"><strong>3 дней</strong></span>, ты не сможешь создавать себе новые, пока не закроешь ее. Поэтому мы призываем тебя не создавать себе глобальных задач, на которые может уйти много времени. Оптимальными, на наш взгляд задачами, будут, например, <strong>Сходить в магазин и по догоге зайти в аптеку,</strong> или <strong>Написать модуль интеграции Paypal с Моим Новым Движком</strong>, или <strong>Отжаться 20 раз</strong>, или <strong>Отфотошопить 10 фоток</strong>, или <strong>Помыть пол на кухне и ванной</strong>, или..... <br /><br /><span style=\"font-size: medium;\">Или все, что в голову взбредет!<br /></span> <br /> Более подробную инструкцию ты сможешь найти в Личном кабинете, пройдя регистрацию. Так что вперед, бродяга! Кто сделает это, если не ты??!<br /><br /><a href=\"/auth/register\"><span style=\"font-size: medium;\">Зарегистрироваться</span></a><br />',0,NULL,1,'about',0,'/',5,'','chto-takoe-microtasker','Что такое microTasker?','',''),(3,'Обратная связь','Отправьте нам сообщение и мы свяжемся с Вами как можно быстрее!',0,NULL,1,'contactus',0,'/',5,'','obratnaya-svyaz','Обратная связь - Проект DEV2','',''),(4,'Регистрация','',0,NULL,0,'register',0,'/',5,NULL,'registraciya','Регистрация','',''),(5,'Восстановление пароля','Нажмите кнопку \"Восстановить пароль\" и на указанный Вами при регистрации адрес электронной почты придет ссылка на восстановление пароля. ',0,NULL,1,'auth_forgot_password',0,'/',5,NULL,'vosstanovlenie-parolya','Восстановление пароля','',''),(6,'Восстановление пароля. Выслано письмо.','На указанный вами Email-адрес выслано письмо.',0,NULL,1,'auth_forgot_password_thanks',1,'/',5,'','vosstanovlenie-parolya-vyslano-pismo','Восстановление пароля. Выслано письмо.','',''),(7,'Восстановление пароля. Отправлено СМС','',0,NULL,1,'auth_forgot_sms',0,'/',5,NULL,'vosstanovlenie-parolya-otpravleno-sms','Восстановление пароля. Отправлено СМС','',''),(8,'Придумайте новый пароль','',0,NULL,1,'auth_password_recovery',0,'/',5,NULL,'pridumayte-novyy-parol','Придумайте новый пароль','',''),(9,'Вход в личный кабинет','',0,NULL,1,'auth_signin',0,'/',5,NULL,'vhod-v-lichnyy-kabinet','Вход в личный кабинет','',''),(10,'Регистрация пройдена','Благодарим за регистрацию в системе <strong>Microtasker</strong>! Вы можете пользоваться системой прямо сейчас!<br />',0,NULL,1,'auth_registration_complete',1,'/',5,'','registraciya-proydena','Регистрация пройдена','',''),(11,'Активация пройдена','Теперь вы можете войти в Личный кабинет!',0,NULL,1,'auth_activation_successful',1,'/profile',3,'','aktivaciya-proydena','Активация пройдена','',''),(12,'Пользовательское соглашение','<strong>Пользовательское соглашение</strong> предусматривает, что<br /><ol>\r\n<li>1. Вы будете создавать себе задачи, выполнять их и отмечать их выполнение</li>\r\n<li>2. Вы не будете отмечать задачу, которую еще не выполнили</li>\r\n<li>3. Вы будете получать отчет о выполненных задачах раз в неделю</li>\r\n</ol><strong>Пользовательское соглашение </strong>- это не шутки, помните об этом<br /><br /><br />',0,NULL,1,'user_agreement',0,'/',5,'','polzovatelskoe-soglashenie','Пользовательское соглашение','',''),(13,'Политика конфиденциальности','Здесь абсолютно типичная страница про политику конфиденциальности',0,NULL,1,'privacy_policy',0,'/',5,'','politika-konfidencialnosti','Политика конфиденциальности','',''),(14,'Закрытый раздел','Если вы зашли на эту страницу, значит вы авторизованный пользователь!',0,NULL,1,NULL,0,'/',5,NULL,'zakrytyy-razdel','Закрытый раздел','',''),(15,'Это тестовая страница','',0,NULL,1,NULL,0,'/',5,'','eto-testovaya-stranica','Это тестовая страница','',''),(16,'Ошибка 404','Ошибка 404. Страница не найдена',0,NULL,1,'error404',0,'/',5,NULL,'oshibka-404','Ошибка 404','',''),(17,'Мой профиль','Здесь вы можете отредактировать Ваши личные данные, загрузить фотографию и поменять пароль',0,NULL,0,'profile',0,'/',5,NULL,'moy-profil','Мой профиль','',''),(18,'Мой профиль - Изменить пароль','Мы храним Ваш пароль в зашифрованном виде. Кроме Вас его не знает никто',0,NULL,0,'profile_password',0,'/',5,NULL,'moy-profil-izmenit-parol','Мой профиль - Изменить пароль','',''),(19,'Мой профиль - Изменить фотографию','',0,NULL,0,'profile_avatar',0,'/',5,NULL,'moy-profil-izmenit-fotografiyu','Мой профиль - Изменить фотографию','',''),(20,'IP-адресс заблокирован','К сожалению, по неясным причинам ваш адрес был заблокирован! Спасибо!',0,NULL,1,'ip_banned',0,'/',5,'empty','ip-adress-zablokirovan','IP-адресс заблокирован','',''),(21,'Необходима авторизация','Чтобы посмотреть содержимое этого раздела, необходимо авторизоваться',0,NULL,1,'auth_secure',0,'/',5,NULL,'neobhodima-avtorizaciya','Необходима авторизация','',''),(22,'Подтверждение аккаунта в соцсети','Внимание! Email {%email%} уже существует в системе! Если это Ваш email, подтвердите его!',0,NULL,1,'oauth_bridge',0,'/',5,NULL,'confirmation-of-account-in-socconfirm-your-social-networks-accountial-networks','Подтверждение аккаунта в соцсети','',''),(23,'Подтверждение аккаунта в соцсети. Шаг второй','На ваш электронный ящик {%email%} выслано письмо!',0,NULL,1,'oauth_bridge_confirm',0,'/',5,NULL,'podtverzhdenie-akkaunta-v-socseti-shag-vtoroy','Подтверждение аккаунта в соцсети. Шаг второй','',''),(24,'Ошибка авторизации OAuth','',0,NULL,1,'oauth_error',0,'/',5,NULL,'oshibka-avtorizacii-oauth','Ошибка авторизации OAuth','',''),(25,'Пользователи',NULL,0,NULL,1,'users_index',0,'/',5,NULL,'users_index','Пользователи',NULL,NULL),(26,'{%name%}',NULL,0,NULL,1,'users_show',0,'/',5,NULL,'users_show','{%name%}',NULL,NULL),(27,'{%name%} на карте',NULL,0,NULL,1,'users_show_map',0,'/',5,NULL,'users_show_map','{%name%} на карте',NULL,NULL),(28,'Заготовки',NULL,1,'preset',0,'preset_index',0,'/',5,NULL,'microtaskpresets','Заготовки',NULL,NULL),(29,'Заготовки','<strong>Заготовки</strong> - это отличный способ не писать по 10 раз одну и ту же задачу(напр, отжаться 10 раз, поиграть на бас-гитаре), а просто выбрать ее из выпадающего списка',1,'preset',1,'preset_my',0,'/',5,'','zagotovki','Заготовки','',''),(30,'{%name%}\'s MicrotaskPresets',NULL,1,'preset',0,'preset_user',0,'/',5,NULL,'name-s-microtaskpresets','{%name%}\'s MicrotaskPresets',NULL,NULL),(31,'Создать заготовку',NULL,1,'preset',0,'preset_new',0,'/',5,NULL,'new-microtaskpreset','Создать заготовку',NULL,NULL),(32,'Редактировать заготовку',NULL,1,'preset',0,'preset_edit',0,'/',5,NULL,'edit-microtaskpreset-name','Редактировать заготовку',NULL,NULL),(33,'Отчеты','Пока <strong>Microtasker</strong> не создал для вас ни одного очтета. Ваш первый отчет будет создан в ближайшее воскресение. Благодарим за терпение!',0,NULL,1,'reports',0,'/',5,'','otchety','Отчеты','','');
